import img1 from '../Images/d.jpg'
import img2 from '../Images/ext3.jpg'
import img3 from '../Images/ext1.jpg'
import img4 from '../Images/be.jpg'
import img5 from '../Images/db.jpg'
import img6 from '../Images/ext2.jpg'

const Sdata = [
    {
        imgsrc: img1,
        service: "Design"
    },
    {
        imgsrc: img2,
        service: "Web Devlopment"
    },
    {
        imgsrc: img3,
        service: "Youtube"
    },
    {
        imgsrc: img4,
        service: "MERN Stack"
    },
    {
        imgsrc: img5,
        service: "Database"
    },
    {
        imgsrc: img6,
        service: "Database"
    },
]



export default Sdata;
